    //flexDirection: 'row'

  },

  text:{
      alignSelf: "center",
      fontFamily: "Verdana-Bold",
      fontSize: 30,
      color: "#66FCF1"
  },

  signUpText:{

    fontFamily: "Verdana",
    fontSize: 15,
    color: 'gray',
  },

  signUpView: {
    marginTop: 150,
    flexDirection: 'row', 
    marginBottom: 20, 
